import React, { Component } from 'react'

export default class App extends Component {
   

    render() {
        const newUser = this.state.users.map((user) =>{
            console.log(user);
            return <h1 key={user.id}>ID: {user.id} Name: {user.name} Pass: {user.password}</h1>
        })
        return (
            <div>
                {newUser}
            </div>
        );
               
                     
    }
}
